import React from 'react';
import Tracker from '../components/Tracker';
import './Home.css';

const Home: React.FC = () => (
  <div className="home">
    <h1>Fitness Tracker</h1>
    <p>Track your fitness journey and stay motivated!</p>
    <Tracker />
  </div>
);

export default Home;
